import React, { Component } from "react";
import Item from "../comps/item";
import styled from "styled-components";

const ListContainer = styled.div`
  display: flex;
  justify-content: start;
  flex-wrap: wrap;
`;

export default class ItemList extends Component {
  render() {
    return (
      <ListContainer>
        <Item></Item>
      </ListContainer>
    );
  }
}
